import React, { Component } from './../../node_modules/react';

class SiteSection extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className={"site-half" + this.props.block}>
                <div className={"img-bg-1" + this.props.right} style={{backgroundImage: 'url('+ this.props.image + ')'}} data-aos="fade" />
                <div className="container">
                    <div className="row no-gutters align-items-stretch">
                        <div className={"col-lg-5 " + this.props.style + " py-5"}>
                        <span className="caption d-block mb-2 font-secondary font-weight-bold">Enjoy life</span>
                        <h2 className="site-section-heading text-uppercase font-secondary mb-5">Relaxing</h2>
                        <p>You dont always need a plan. Sometimes you just need to breathe, trust, let go and see what happens</p>
                        <blockquote cite="http://www.worldwildlife.org/who/index.html"><p>Bạn không phải lúc nào cũng cần có một kế hoạch. Đôi khi bạn chỉ cần thở, tin tưởng, buông tay và xem điều gì xảy ra</p> </blockquote> 
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default SiteSection;
